import Feature from './Feature';

const divStyle = {
  //marginLeft: 400,
  //marginRight: 400,
}

const layoutStyle = {
  padding: 20,
  border: '1px solid #DDD',
  height: 600,
};

const FeatureLayout = props => (
  <div style={divStyle}>
    <div style={layoutStyle}>
      <Feature />
      {props.children}
    </div>
  </div>
);

export default FeatureLayout;
